An undercover cop just rammed through peaceful protestors in Times Square. Feel free to share.

This evening there was a BLM gathering met with a very small counter-protest of five citizens in MAGA hats. Freedom of speech, they had equal rights to be there as people did to heckle them. Eventually as the crowd gathered they retreated into the usual army of cops around times square, who formed a wall facing the crowd. They eventually made their way onto 46th Street and ducked under some construction while the NYPD called in SRG officers to clear the sidewalk and escort their fellow fascists home. As the crowd began to march, they took the express route through us. 

This was an NYPD undercover car model. 2013 Ford Tarus with Police Trim. Registered privately a month ago (thanks licenseplatedata.com). Through the tinted windows I was able to see one of the redhats riding shotgun and a whiteshirt driving. 

EDIT: I am safe. I was able to jump out of the way and avoid getting hit. Thank you to everyone who has reached out. Thankfully there were only minor injuries in the crowd. This could have ended worse.

